import time

start_time = time.time()






class Solution:
    def maxVowels(self, s: str, k: int) -> int:
        # vowels=["a","e","i","o","u"]
        # max_vowels=0
        # for i in range(len(s)-k+1):
        #     substring=s[i:i+k]
        #     count=0
        #     for j in range(len(substring)):
        #         if substring[j] in vowels:
        #             count+=1
        #     if count>max_vowels:
        #         max_vowels=count
        # return max_vowels
        vowels = set(["a", "e", "i", "o", "u"])
        max_vowels = 0
        count = 0

        # Initialize the count for the first k characters
        for i in range(k):
            if s[i] in vowels:
                count += 1
                max_vowels = count

        # Use a sliding window to update the count efficiently
        for i in range(k, len(s)):
            if s[i - k] in vowels:
                count -= 1
            if s[i] in vowels:
                count += 1
            max_vowels = max(max_vowels, count)

        return max_vowels
    
